import * as axios from "axios";

const instance = axios.create({
  withCredentials: true,
  baseURL: "https://localhost/127.0.0.1:27017/"
});

export const shopAPI = {
    getShop() {
        return instance.get("Shop.games").then(response => {
            return response.data;
        });
    }
}
